function mapOrderControlCode(fhirOrderControlCode)
{
    if (!fhirOrderControlCode || fhirOrderControlCode.trim() == '')
    {
        return '';
    }

    return fhirOrderControlCode;
}

function normalizeNdcCode(ndcCode)
{
	return normalizeStringValue(ndcCode).replace(/-/g, "");
}

function buildMshMessageControlId(prefix)
{
	var mirthMessageIdFormatted = java.lang.String.format("%010.0f", connectorMessage.getMessageId());
	var messageControlIdRaw = "OMP_" + mirthMessageIdFormatted;
	var messageControlId = (prefix && prefix.trim() != '' ? prefix + messageControlIdRaw : messageControlIdRaw);
	return messageControlId
}

importPackage(com.mirth.connect.server.userutil);
importPackage(com.jayway.jsonpath);

var logHeader = '';

try
{
	//Enable logging to channel-specific logfiles
	activateChannelLogging();

	logHeader = buildChannelLogMsgHeader('', [
		{ 'CHANNEL': channelName },
	     { 'INTEGRATION': 'PBM-OMP' },	     { 'VENDOR' : $('HHH_MY_CHANNEL_VALIDATION_VENDOR_ID') },
		{ 'SOURCE-IP' :  $('remoteAddress') },
	]);

	logger.debug(logHeader + 'Transformer - Entry');

	//initialize the responseMap entry to enable it to appear 'response' drop-down in the 'Source Settings' on the source connector
	responseMap.put('response', '');

	//Set the ID of the generated FHIR bundle for the response to the Mirth message ID
	var fhirOmpRespBundleId = UUIDGenerator.getUUID();
	channelMap.put('fhirOmpRespBundleId',fhirOmpRespBundleId);
	channelMap.put('fhirOmpRespBundleIdentifier',new java.lang.Integer(connectorMessage.getMessageId()));  //See http://www.mirthproject.org/community/forums/showthread.php?t=13139

	//file names for the input FHIR OMP request, output FHIR response bundles; we archive the FHIR request/response for troubleshooting and testing purposes
	//channelMap.put('fhirOmpReqJsonFile', fhirOmpRespBundleId + '.json');
	//channelMap.put('fhirOmpRespJsonFile', fhirOmpRespBundleId + '.json');

	//file name for the generated HL7 OMP; we archive the HL7 for troubleshooting and testing purposes
	channelMap.put('hl7OmpReqFile', fhirOmpRespBundleId + '.hl7');

