	}
	else if (!bundleProfileListJson || JSON.parse(bundleProfileListJson).length == 0)
	{
		logger.warn(logHeader + 'FHIR Profile Validation Disabled- Mirth Global Configuration Variable "HHH_MY_CHANNEL_VALIDATION_OMP_FHIR_SUPPORTED_PROFILES" is either not defined or is an empty list');
	}
	else
	{
		var validProfileUriList = JSON.parse(bundleProfileListJson);

		//validate that the bundle has a profile URI (required for profile validation)
		var profileListJP = ctx.read('$.meta.profile');
		if (!profileListJP)
		{
			var errorMessage = 'Validation Error: Bundle Profile URI (Bundle.meta.profile[1]) is not defined. Supported Profile URI\'s: ' + bundleProfileListJson;
			logger.error(logHeader + errorMessage);
			return createCustomOperationOutcomeResponse('fatal', 'invalid', '', 'MSG_BAD_FORMAT', 'Invalid FHIR OMP JSON', errorMessage, 'Bundle.meta.profile[1]', 400, null, null);
		}

		var profileListJson = profileListJP.toJSONString();
		var profile = normalizeStringValue(parseReadGetFirst(parseConf, profileListJson, '$[0]'));
		if (profile == "")
		{
			var errorMessage = 'Validation Error: Bundle Profile URI (Bundle.meta.profile[1]) is not defined. Supported Profile URI\'s: ' + bundleProfileListJson;
			logger.error(logHeader + errorMessage);
			return createCustomOperationOutcomeResponse('fatal', 'invalid', '', 'MSG_BAD_FORMAT', 'Invalid FHIR OMP JSON', errorMessage, 'Bundle.meta.profile[1]', 400, null, null);
		}

		//validate the profile URI is supported
		if (!validProfileUriList.indexOf(profile.trim()) < 0 || profile.trim() != validProfileUriList[validProfileUriList.indexOf(profile.trim())])
		{
			var errorMessage = 'Validation Error: Value "' + profile + '" for Bundle Profile URI (Bundle.meta.profile) is not supported. Supported profiles: ' + bundleProfileListJson;
			logger.error(logHeader + errorMessage);

			return createCustomOperationOutcomeResponse('fatal', 'invalid', '', 'MSG_BAD_FORMAT', 'Invalid FHIR OMP JSON', errorMessage, 'Bundle.meta.profile[1]', 400, null, null);
		}

		//validate the Bundle against the specified profile
		var fhirValidator = globalChannelMap.get('FhirProfileValidator');
		if (fhirValidator)
		{
			var result = fhirValidator.validate(json);
			var operationOutcomeJson = result.toJSON();
			var errorCount = result.getErrorMessages().size();
			var warnCount = result.getWarningMessages().size();
			var noticeCount = result.getInformationMessages().size();
			if (!result.isSuccessful())
			{
				logger.error(logHeader + 'FHIR Profile Validation Failed (Errors=' + errorCount + ', Warnings=' + warnCount + ', Notices=' + noticeCount  + ': ' + operationOutcomeJson);
				return createCustomOperationOutcomeResponse('fatal', 'invalid', '', 'MSG_BAD_FORMAT', 'Invalid FHIR OMP JSON', 'FHIR Profile Validation Failed', null, 400, null, operationOutcomeJson);
			}
			else
			{
				logger.debug(logHeader + 'FHIR Profile Validation Succeeded (Errors=' + errorCount + ', Warnings=' + warnCount + ', Notices=' + noticeCount + ': ' + operationOutcomeJson);
			}
		}
		else
		{
			logger.warn(logHeader + 'Skipping FHIR profile validation - FHIR Validator is not initialized');
		}
	}

	//Get the FHIR OMP JSON - Local Dev/Testing outside Mirth
