	    episodeOfCareCareManagerLastName =  parseReadGetFirst(parseConf, episodeOfCareCareManager, '$.name[0].family');
	    episodeOfCareCareManagerFirstName =  parseReadGetFirst(parseConf, episodeOfCareCareManager, '$.name[0].given[0]');
