	var encounterAdmissionKey =  parseReadGetFirst(parseConf, encounterListJson, '$[0].identifier[?(@.system == "http://kinnser.com/FHIR/Coding/HHH/Admission-Key")].value');
	var encounterEpisodeKey =  parseReadGetFirst(parseConf, encounterListJson, '$[0].identifier[?(@.system == "http://kinnser.com/FHIR/Coding/HHH/Episode-Key")].value');
	var encounterLevelOfCareKey =  parseReadGetFirst(parseConf, encounterListJson, '$[0].identifier[?(@.system == "http://kinnser.com/FHIR/Coding/HHH/Level-Of-Care-Key")].value');
	var encounterClinicTypeKey =  parseReadGetFirst(parseConf, encounterListJson, '$[0].extension[?(@.url == "http://wellsky.com/FHIR/HHH/DSTU3/StructureDefinition/clinic-type")].valueCode');
	var encounterClassCode = parseRead(parseConf, encounterListJson, '$[0].class.code');
