	//Extract the values for the admitting, attending and referring providers from the FHIR Encounter resource
	logger.debug(logHeader + 'Extracting FHIR Encounter Participants');
	var encounterParticipantList = parseRead(parseConf, encounterListJson, '$[0].participant');
	var encounterAdmittingParticipantNPI = "";
	var encounterAdmittingParticipantDEA = "";
	var encounterAdmittingParticipantLastName = "";
	var encounterAdmittingParticipantFirstName = "";
	var encounterAdmittingParticipantMiddleName = "";
