	var encounterAttendingParticipantDEA = "";
	var encounterAttendingParticipantLastName = "";
	var encounterAttendingParticipantFirstName = "";
	var encounterAttendingParticipantMiddleName = "";
	var encounterReferringParticipantNPI = "";
	var encounterReferringParticipantDEA = "";
	var encounterReferringParticipantLastName = "";
	var encounterReferringParticipantFirstName = "";
	var encounterReferringParticipantMiddleName = "";
	if (encounterParticipantList)
	{
		var encounterParticipantListJson = encounterParticipantList.toJSONString();

		for (var k = 0; k < encounterParticipantList.size(); k++)
