		    var particpantJson = parseRead(parseConf, encounterParticipantListJson, '[' + k + ']');

		    var participantTypeCode = parseReadGetFirst(parseConf, particpantJson, '$.type[0].coding[?(@.system == "http://hl7.org/fhir/v3/ParticipationType")].code');

		    var particpantRef = parseRead(parseConf, particpantJson, '$.individual.reference');

		    if (participantTypeCode && participantTypeCode == 'ADM')
		    {
		        logger.debug(logHeader + 'Extracting FHIR Encounter properties - Admitting Practitioner');
		        var admittingPractitioner = parseReadGetByResRef(parseConf, practitionerListJson, particpantRef);
		        encounterAdmittingParticipantNPI = parseReadGetFirst(parseConf, admittingPractitioner, '$.identifier[?(@.system == "http://hl7.org/fhir/sid/us-npi")].value');
		        encounterAdmittingParticipantDEA = parseReadGetFirst(parseConf, admittingPractitioner, '$.identifier[?(@.system == "http://hl7.org/fhir/sid/us-dea")].value');
		        encounterAdmittingParticipantLastName =  parseReadGetFirst(parseConf, admittingPractitioner, '$.name[0].family');
		        encounterAdmittingParticipantFirstName =  parseReadGetFirst(parseConf, admittingPractitioner, '$.name[0].given[0]');
		        encounterAdmittingParticipantMiddleName =  parseReadGetFirst(parseConf, admittingPractitioner, '$.name[0].given[1]');
		    }
		    else if (participantTypeCode && participantTypeCode == 'ATND')
		    {
		    	   logger.debug(logHeader + 'Extracting FHIR Encounter properties - Attending Practitioner');
		        var attendingPractitioner = parseReadGetByResRef(parseConf, practitionerListJson, particpantRef);
		        encounterAttendingParticipantNPI = parseReadGetFirst(parseConf, attendingPractitioner, '$.identifier[?(@.system == "http://hl7.org/fhir/sid/us-npi")].value');
		        encounterAttendingParticipantDEA = parseReadGetFirst(parseConf, attendingPractitioner, '$.identifier[?(@.system == "http://hl7.org/fhir/sid/us-dea")].value');
		        encounterAttendingParticipantLastName =  parseReadGetFirst(parseConf, attendingPractitioner, '$.name[0].family');
		        encounterAttendingParticipantFirstName =  parseReadGetFirst(parseConf, attendingPractitioner, '$.name[0].given[0]');
		        encounterAttendingParticipantMiddleName =  parseReadGetFirst(parseConf, attendingPractitioner, '$.name[0].given[1]');
		    }
		    else if (participantTypeCode && participantTypeCode == 'REF')
		    {
