		rxoXml['RXO.14']['RXO.14.01'] = normalizeStringValue(medReqOrderingPractitionerDEA);
		rxoXml['RXO.14']['RXO.14.02'] = normalizeStringValue(medReqOrderingPractitionerLastName);
		rxoXml['RXO.14']['RXO.14.03'] = normalizeStringValue(medReqOrderingPractitionerFirstName);
		rxoXml['RXO.14']['RXO.14.05'] = "";
		rxoXml['RXO.14']['RXO.14.06'] = "";
		rxoXml['RXO.14']['RXO.14.07'] = "";
		rxoXml['RXO.14']['RXO.14.08'] = "";
		rxoXml['RXO.14']['RXO.14.09'] = (medReqOrderingPractitionerDEA && medReqOrderingPractitionerDEA.trim() != '') ? 'DEA' : ""
		rxoXml['RXO.14']['RXO.14.10'] = "";
		rxoXml['RXO.14']['RXO.14.11'] = "";
		rxoXml['RXO.14']['RXO.14.12'] = "";
		rxoXml['RXO.14']['RXO.14.13'] = (medReqOrderingPractitionerDEA && medReqOrderingPractitionerDEA.trim() != '') ? 'DEA' : ""
		rxoXml['RXO.15'] = "";
		rxoXml['RXO.16'] = "";
		rxoXml['RXO.17'] = ((normalizeStringValue(medReqDosePrn).toLowerCase() == 'true') ? 'PRN' : "");

		tmp['RXO'][0] = rxoXml;

		logger.debug(logHeader + 'Generating HL7 XML - RXR');
		var rxrXml = new XML("<RXR></RXR>");
		rxrXml['RXO.01']['RXR.01.01'] = normalizeStringValue(medReqDoseRouteCode);
		rxrXml['RXO.01']['RXR.01.02'] = normalizeStringValue(medReqDoseRouteText);
		rxrXml['RXO.01']['RXR.01.03'] = normalizeStringValue(medReqDoseRouteSystemType);

		tmp['RXR'][0] = rxrXml;
	}

	//Generate the HL7 and save it in the map
	logger.debug(logHeader + 'Serializing HL7 OMP');
	var hl7OmpReq = SerializerFactory.getSerializer('HL7V2').fromXML(tmp);
	logger.debug(logHeader + 'HL7 OMP Serialization Complete');

	if (IsBooleanMapOptionEnabled('HHH_MY_CHANNEL_VALIDATION_VERBOSE_LOGGING_ENABLED', false))
	{
		logger.debug(logHeader + 'HL7 OMP Message: ' + hl7OmpReq);
	}

	channelMap.put('hl7OmpReq', hl7OmpReq);

	channelMap.put('logHeader', logHeader);

	logger.info(logHeader + 'HL7 OMP^' +  messageHeaderTriggerEventCode + ' Generated');

	//publish an event that the message has been received
	var statusCode = 'MSG_ACCEPTED'
	var outcome = createCustomOperationOutcome('information', 'informational', 'http://kinnser.com/FHIR/Coding/Services/Operation-Outcome-Details', statusCode, 'Message Received and Accepted for Delivery', logMsg, '', null, null, null);

	logger.debug(logHeader + 'Transformer - Exit');
} catch (e) {
	var errorSource = 'Channel=' + channelName + '; Transformer=' + connectorMessage.getConnectorName();
	var logMsg = 'Unexpected exception in ' + errorSource + ' - ' + e;
	logger.error(logHeader + logMsg);

	return createCustomOperationOutcomeResponse('fatal', 'exception', '', '', '', '' , errorSource, 500, e);
}

try
{
	var DEFAULT_MAX_ATTEMPTS = 10;

	var maxFailedAttempts = DEFAULT_MAX_ATTEMPTS;

	if ($('HHH_MY_CHANNEL_VALIDATION_OMP_MAX_DELIVERY_ATTEMPTS') && $('HHH_MY_CHANNEL_VALIDATION_OMP_MAX_DELIVERY_ATTEMPTS').trim() != '')
	{
		maxFailedAttempts = parseInt($('HHH_MY_CHANNEL_VALIDATION_OMP_MAX_DELIVERY_ATTEMPTS'));
	}

	//save the HTTP response
	var responseElements = $('responseStatusLine').split(" ");
    channelMap.put("hl7OmpReqPostStatusMsg", $('responseStatusLine'));
    channelMap.put("hl7OmpReqPostStatusVersion", responseElements[0]);
    channelMap.put("hl7OmpReqPostStatusCode", responseElements[1]);
    channelMap.put("hl7OmpReqPostStatusReason", responseElements[2]);
    channelMap.put("hl7OmpReqPostResponseData",connectorMessage.getResponseData());

	var indefiniteQueueingEnabled = IsBooleanMapOptionEnabled('HHH_MY_CHANNEL_VALIDATION_OMP_INDEFINITE_QUEUEING_ENABLED');
	logger.debug($c('logHeader') + 'Retry Configuration: [Indefinite-Queueing-Enabled=' + indefiniteQueueingEnabled + '] [Max-Delivery-Attempts=' + maxFailedAttempts + ']');

	var logMsg;
	if (!$('responseStatusLine') || $('responseStatusLine').trim() == '')
	{
		logger.debug($c('logHeader') +'HTTP Response Status: <none> (Response Data: ' + connectorMessage.getResponseData() + ')');
	}
	else
	{
		logger.debug($c('logHeader') +'HTTP Response Status: ' + $('responseStatusLine'));

		logger.debug($c('logHeader') + 'HTTP Response Body: ' + response.getMessage());

		var httpStatusCode = parseInt(responseElements[1]);
		if (httpStatusCode >= 300 && responseStatus != ERROR)
		{
			if (indefiniteQueueingEnabled)
			{
				logger.debug($c('logHeader') + "Re-queueing message for re-delivery (ATTEMPTS=" + connectorMessage.getSendAttempts() + ")");
				responseStatus = QUEUED;
			}
			else
			{
				var logMsg = 'Transitioning response status from ' + responseStatus + ' to ERROR due to HTTP Status Code (' + httpStatusCode + ')';
				logger.error($c('logHeader') + logMsg);
				responseStatus = ERROR;
			}
		}
	}

	//
	if (responseStatus == QUEUED && connectorMessage.getSendAttempts() >= maxFailedAttempts && !indefiniteQueueingEnabled)
	{
		var logMsg = 'Transitioning response status from ' + responseStatus + ' to ERROR due to maximum failed attempts reached (' + maxFailedAttempts + ')';
		logger.error($c('logHeader') + logMsg);
		responseStatus = ERROR;
	}

	if (responseStatus == SENT)
	{
		//attempt to parse the HTTP response body as HL7
		var hl7RespMsg;
		try
		{
			//strip any lines that do not start with 'MSH', 'MSA' or 'ERR'
			//This is needed to handle stacktraces errors from the vendor that are embedded in the HL7 ACK and  not formatted correctly
			var responseBodyLines =  response.getMessage().split('\n');
			var responseMessageFiltered = '';
			responseBodyLines.forEach(function(line) {
				if (line.indexOf('MSH') == 0 || line.indexOf('MSA') == 0 || line.indexOf('ERR') == 0)
				{
					responseMessageFiltered += line;
					responseMessageFiltered += '\n';
				}
			});

			logger.debug($c('logHeader') + 'HTTP Response Body Filtered: ' + responseMessageFiltered);

			hl7RespMsg = new XML(SerializerFactory.getSerializer('HL7V2').toXML(responseMessageFiltered));

		}
		catch (e)
		{
			logger.error($c('logHeader') + ' Response is invalid HL7: ' + e);
			if (indefiniteQueueingEnabled)
			{
				logger.debug($c('logHeader') + "Re-queueing message for re-delivery (ATTEMPTS=" + connectorMessage.getSendAttempts() + ")");
				responseStatus = QUEUED;
			}
			else
			{
				var logMsg = 'Transitioning response status from ' + responseStatus + ' to ERROR due to received invalid HL7 ACK';
				logger.error($c('logHeader') + logMsg);
				responseStatus = ERROR;
			}
		}

		if (hl7RespMsg && responseStatus == SENT)
		{
			var ackCode = hl7RespMsg['MSA']['MSA.1']['MSA.1.1'].toString().toUpperCase();
			var controlId = hl7RespMsg['MSA']['MSA.2']['MSA.2.1'].toString();
			var ackMessage = hl7RespMsg['MSA']['MSA.3']['MSA.3.1'].toString();

			//log the body of the HTTP response (HL7) received from the server
			logger.info($c('logHeader') + 'OMP ACK Message: ' + response.getMessage());

			if ((ackCode == 'AA' || ackCode == 'CA') && responseStatus == 'SENT')
			{
				var logMsg = 'OMP Acccepted: [ACK-CODE=' + ackCode + '; MSG=' +ackMessage + ']'
				logger.debug($c('logHeader') + logMsg);
			}
			else if ((ackCode == 'AR' || ackCode == 'CR' || ackCode == 'AE' || ackCode == 'CE') && responseStatus == 'SENT')
			{
				var logMsg = 'OMP Rejected/Error: [ACK-CODE=' + ackCode + '; MSG=' + ackMessage + ']'
				logger.error($c('logHeader') +  logMsg);

				responseStatus = ERROR;
			}
			else
			{
				var logMsg = 'Invalid ACK Code: "' + ackCode + '"';
				logger.error($c('logHeader') +  logMsg);

				if (indefiniteQueueingEnabled)
				{
					logger.debug($c('logHeader') + "Re-queueing message for re-delivery (ATTEMPTS=" + connectorMessage.getSendAttempts() + ")");
					responseStatus = QUEUED;
				}
				else
				{
					responseStatus = ERROR;
				}
			}
		}
	}

	if (responseErrorMessage && responseErrorMessage.trim() != '')
	{
		logger.error($c('logHeader') + 'OMP Message Status: [STATUS=' + responseStatus + '; ATTEMPTS=' + connectorMessage.getSendAttempts() + '; STATUSMSG=' + responseStatusMessage + '; ERRORMSG=' + responseErrorMessage + ']');
	}
	else
	{
		logger.info($c('logHeader') + 'OMP Message Status: [STATUS=' + responseStatus + '; ATTEMPTS=' + connectorMessage.getSendAttempts() + '; STATUSMSG=' + responseStatusMessage + ']');
	}
}
catch (e)
{
	if (indefiniteQueueingEnabled)
	{
		logger.error($c('logHeader') + 'Unexpected exception ocurred while processing response: ' + e);
		logger.debug($c('logHeader') + "Re-queueing message for re-delivery (ATTEMPTS=" + connectorMessage.getSendAttempts() + ")");
		responseStatus = QUEUED;
	}
	else
	{
		var logMsg = 'Transitioning response status from ' + responseStatus + ' to ERROR due to unexpected exception while processing response: ' + e;
		logger.error($c('logHeader') + logMsg);
		responseStatus = ERROR;
	}
}

