//Create an instance of our custom DSTU3ProfileValidator class; we have to use Java reflection to circumvent Mirth's standard class loading scheme
function localInitValidator()
{
	logger.info('Initializing FhirProfileValidator');

	var contextClassLoader = java.lang.Thread.currentThread().getContextClassLoader();
	var isolatedClassLoader = contextFactory.getIsolatedClassLoader();
	var stringClazz = isolatedClassLoader.loadClass('java.lang.String');

	//initialize a ProfileValidatorConfig instance
	var profileValidatorConfigClazz = isolatedClassLoader.loadClass('com.wellsky.hhh.fhir.utils.validation.dstu3.ProfileValidatorConfig');
	var profileValidatorConfigCtor = profileValidatorConfigClazz.getDeclaredConstructor(null);
	var profileValidatorConfig = profileValidatorConfigCtor.newInstance();
	profileValidatorConfig.setConformanceResourcesManifestFile(configurationMap.get('HHH_MY_CHANNEL_VALIDATION_FHIR_PROFILE_MANIFEST_FILE'));

	//initialize a ProfileValidator instance
	var profileValidatorClazz = isolatedClassLoader.loadClass('com.wellsky.hhh.fhir.utils.validation.dstu3.ProfileValidator');
	var profileValidatorCtor = profileValidatorClazz.getDeclaredConstructor(profileValidatorConfigClazz);
	var profileValidator = profileValidatorCtor.newInstance(profileValidatorConfig);

	var profileCount = profileValidator.getProfiles().size();
	var codeSystemCount = profileValidator.getCodeSystems().size();
	var valueSetCount = profileValidator.getValueSets().size();

	logger.info('FhirProfileValidator Initialized: ' + profileCount + ' StructureDefinitions, ' + codeSystemCount + ' CodeSystems, ' + valueSetCount + ' ValueSets');

	//our single instance of the profile validator (created during first request)
	globalChannelMap.put('FhirProfileValidator', profileValidator);
}


