/**
	Sets the resource ID, version ID, and last updated date/time.

	@param {IBaseResource} resource - The FHIR resource object.
	@param {String} id - The logical ID of the resource.
	@param {Number} versionId - The version ID of the resource.
	@return {Date} The last updated date/time.
*/
function updateResourceMeta(resource, id, versionId) {
	resource.setId(id);
	resource.getMeta().setVersionId(new String(versionId));
	var lastUpdated = new java.util.Date();
	resource.getMeta().getLastUpdatedElement().setTimeZone(java.util.TimeZone.getDefault());
	resource.getMeta().setLastUpdated(lastUpdated);
	return lastUpdated;
}

/**
	Returns a Javascript object that represents a FHIR OperationOutcome

	@param {String} severityCode - Indicates whether the issue indicates a variation from successful
		processing. Values: fatal | error | warning | information
	@param {String} issueCode - Describes the type of the issue. The system that creates an
		OperationOutcome SHALL choose the most applicable code from the IssueType value set, and may
		additional provide its own code for the error in the details element. Values: invalid | security |
		processing | transient | informational
	@param {String} detailsCodeSystemUri - [Optional] The FHIR coding system that the detailsCode belongs to. If blank the default is used (http://hl7.org/fhir/operation-outcome)
	@param {String} detailsCode - [Optional] A code that qualifies the nature of the outcome (e.g. MSG_UNEXPECTED_EXCEPTION). The code should belong to coding system specified in the detailsCodeSystemUri parameter
	@param {String} detailsCodeDisplayText - [Optional] A textual description/meaning of the detailsCode parameter (e.g. "Unexpected error/exception occurred").
	@param {String} detailsText - [Optional] Additional text that provides details on the outcome
	@param {String} errorSource - [Optional] Detail on the source of the error (e.g. channel name, source/destination name)
	@param {int} httpStatusCode - [Optional] The HTTP status code to send back with the response. Defaults to 400
		if not specified.
	@param {Error} e - [Optional] The error/exception that triggered the creation of the OperationOutcome response.
	@return {Object} The FHIR OperationOutcome as a JS object
*/
function createCustomOperationOutcome(severityCode, issueCode, detailsCodeSystemUri, detailsCode, detailsCodeDisplayText, detailsText, errorSource, httpStatusCode, e) {

    if (!detailsCodeSystemUri || detailsCodeSystemUri.trim() == '')
    {
        detailsCodeSystemUri = 'http://hl7.org/fhir/operation-outcome';
    }

    if (!httpStatusCode) {
		httpStatusCode = 400;
	}

    if (!errorSource || errorSource.trim() == '')
    {
        errorSource = '';
    }

    var errorContent;
    if (e) {
		if (e.rhinoException) {

			if (errorSource == '')
			{
				errorSource = 'Line=' + e.rhinoException.lineNumber();
			}
			else
			{
				errorSource += '; Line=' + e.rhinoException.lineNumber();
			}

			errorContent = 'Source=[' + errorSource + '] : ';
		}
		else
		{
			if (errorSource !== '')
			{
				errorContent = 'Source=[' + errorSource + '] : ';
			}
		}

        errorContent += e.toString();

	   if (e.javaException)
	   {
	   	errorContent += '; ' + e.javaException.toString();
	   }
    }

    if (!detailsCode || detailsCode.trim() == '')
    {
        detailsCodeSystemUri = 'http://kinnser.com/FHIR/Coding/Services/Operation-Outcome-Details';
        detailsCode = 'MSG_UNEXPECTED_EXCEPTION';
        detailsCodeDisplayText = 'Unexpected error/exception occurred';
    }

    if (!detailsText)
    {
        detailsText = '';
    }

    if (errorContent)
    {
        if (detailsText.trim() == '')
        {
            detailsText = errorContent;
        }
        else
        {
            detailsText += '; Error Detail: ' + errorContent;
        }
    }

	var outcome = {
		resourceType: "OperationOutcome",
		id:  UUIDGenerator.getUUID(),
		text: {},
		issue: [
		    {
		    	code: issueCode,
			severity: severityCode,
			details: {
			coding: [
						{
							system: detailsCodeSystemUri ,
							code: detailsCode,
							display: detailsCodeDisplayText
						}
					],
					text: detailsText
				}
		    },
		]
    };

    return outcome;

}

/**
	Creates a FHIR OperationOutcome resource, and adds it to the response map with the key "response" and returns the response. Provides optional parameters to specify details on the error.

	@param {String} severityCode - Indicates whether the issue indicates a variation from successful
		processing. Values: fatal | error | warning | information
	@param {String} issueCode - Describes the type of the issue. The system that creates an
		OperationOutcome SHALL choose the most applicable code from the IssueType value set, and may
		additional provide its own code for the error in the details element. Values: invalid | security |
		processing | transient | informational
	@param {String} detailsCodeSystemUri - [Optional] The FHIR coding system that the detailsCode belongs to. If blank the default is used (http://hl7.org/fhir/operation-outcome)
	@param {String} detailsCode - [Optional] A code that qualifies the nature of the outcome (e.g. MSG_UNEXPECTED_EXCEPTION). The code should belong to coding system specified in the detailsCodeSystemUri parameter
	@param {String} detailsCodeDisplayText - [Optional] A textual description/meaning of the detailsCode parameter (e.g. "Unexpected error/exception occurred").
	@param {String} detailsText - [Optional] Additional text that provides details on the outcome
	@param {String} errorSource - [Optional] Detail on the source of the error (e.g. channel name, source/destination name)
	@param {int} httpStatusCode - [Optional] The HTTP status code to send back with the response. Defaults to 400
		if not specified.
	@param {Error} e - [Optional] The error/exception that triggered the creation of the OperationOutcome response.
	@param {sourceOperationOutcome} - [Optional] An existing OperationOutcome instance as a JSON string. If specified, each issue in sourceOperationOutcome is added to the generated OperationOutcome instance
	@return {Response} The created Response object.
*/
function createCustomOperationOutcomeResponse(severityCode, issueCode, detailsCodeSystemUri, detailsCode, detailsCodeDisplayText, detailsText, errorSource, httpStatusCode, e, sourceOperationOutcome) {

    if (!detailsCodeSystemUri || detailsCodeSystemUri.trim() == '')
    {
        detailsCodeSystemUri = 'http://hl7.org/fhir/operation-outcome';
    }

    if (!httpStatusCode) {
		httpStatusCode = 400;
	}

    if (!errorSource || errorSource.trim() == '')
    {
        errorSource = '';
    }

    var errorContent;
    if (e) {
		if (e.rhinoException) {

			if (errorSource == '')
			{
				errorSource = 'Line=' + e.rhinoException.lineNumber();
			}
			else
			{
				errorSource += '; Line=' + e.rhinoException.lineNumber();
			}

			errorContent = 'Source=[' + errorSource + '] : ';
		}
		else
		{
			if (errorSource !== '')
			{
				errorContent = 'Source=[' + errorSource + '] : ';
			}
		}

        errorContent += e.toString();

	   if (e.javaException)
	   {
	   	errorContent += '; ' + e.javaException.toString();
	   }
    }

    if (!detailsCode || detailsCode.trim() == '')
    {
        detailsCodeSystemUri = 'http://kinnser.com/FHIR/Coding/Services/Operation-Outcome-Details';
        detailsCode = 'MSG_UNEXPECTED_EXCEPTION';
        detailsCodeDisplayText = 'Unexpected error/exception occurred';
    }

    if (!detailsText)
    {
        detailsText = '';
    }

    if (errorContent)
    {
        if (detailsText.trim() == '')
        {
            detailsText = errorContent;
        }
        else
        {
            detailsText += '; Error Detail: ' + errorContent;
        }
    }

	var outcome = {
		resourceType: "OperationOutcome",
		id:  UUIDGenerator.getUUID(),
		text: {},
		issue: [
		    {
		    	code: issueCode,
			severity: severityCode,
			details: {
			coding: [
						{
							system: detailsCodeSystemUri ,
							code: detailsCode,
							display: detailsCodeDisplayText
						}
					],
					text: detailsText
				}
		    },
		]
    };

    if (sourceOperationOutcome)
    {
    		var sourceOperationOutcomeObj = JSON.parse(sourceOperationOutcome);
    		if (sourceOperationOutcomeObj.issue)
    		{
    			for each (var issue in sourceOperationOutcomeObj.issue)
    			{
    				outcome.issue.push(issue);
    			}
    		}
    }

	var message = JSON.stringify(outcome);
	responseMap.put('response', FhirResponseFactory.getResponse(message, httpStatusCode, FhirUtil.getMIMETypeJSON()));
	var response = new Response(message);
	response.setStatusMessage(severityCode.toUpperCase() + ' Custom OperationOutcome created with status ' + httpStatusCode + '.');

	if (httpStatusCode >= 400) {
		response.setStatus(Status.ERROR);

		if (e && errorContent) {
			if (e.javaException) {
				logger.error(errorContent, e.javaException);
			} else {
				logger.error(errorContent);
			}
			response.setError(errorContent);
		}
	}

	return response;
}

/**
	Helper function that attempts to normalize strings and objects that can be converted to string values for insertion into HL7

	Returns:

	- an empty JS string if input is null or undefined
	- a JS string with all leading/trailing whitespace removed and all internal newlines/CR's/tabs replaced with semicolon characters if the object is string
	- a JS string derived from the objects's ToString() method with all leading/trailing whitespace removed and all internal newlines/CR's/tabs replaced with semicolon characters if the object is Java object
	- the object otherwise

	@param {String} arg1 - arg1 description
	@return {String} return description
*/

function normalizeStringValue(obj)
{
    if (!obj)
    {
        return '';
    }
    else if (typeof(obj) == "string")
    {
    	   return obj.replace(/\r|\n|\t/gm,";").trim();
    }
    else if (obj instanceof java.lang.Object)
    {
        return String(obj.toString()).valueOf().replace(/\r|\n|\t/gm,"; ").trim();
    }
    else
    {
        return obj;
    }
}

function validateValueDefinedAndNonWhitespace(logHeader, errors, description, value)
{
	var valueNormalized = normalizeStringValue(value);

	if (valueNormalized == '')
	{
		var msg  = 'Validation Error: \'' + description + '\' is either not specified or does not contain at least one non-whitespace character\'';

		logger.error(logHeader + msg);

		if (errors)
		{
			errors.push(msg);
		}

		return false;
	}

	return true;
}

function validateValueDefinedAndInList(logHeader, errors, description, value, valueList)
{
	if (!validateValueDefinedAndNonWhitespace(logHeader, errors, description, value))
	{
		return false;
	}

	var valueNormalized = normalizeStringValue(value);

	if (valueList && Array.isArray(valueList) && valueList.length > 0)
	{
		if (valueList.indexOf(valueNormalized) < 0)
		{
			var validValueListString = ''
			for (i=0; i < valueList.length; i++)
			{
				if (i == 0)
				{
					validValueListString += '\'' + valueList[i] + '\'';
				}
				else
				{
					validValueListString += ', \'' + valueList[i] + '\'';
				}
			}

			var msg  = 'Validation Error: Value \'' + valueNormalized  +  '\' for ' + description + ' is invalid. Valid values: ' + validValueListString;

			logger.error(logHeader + msg);

			if (errors)
			{
				errors.push(msg);
			}

			return false;
		}
	}

	return true;
}

