function getJsonPathParsingConfig()
{
	var parseConfTemp1 = com.jayway.jsonpath.Configuration.defaultConfiguration();
	var parseConfTemp2 = parseConfTemp1.addOptions(Option.DEFAULT_PATH_LEAF_TO_NULL);
	var parseConf = parseConfTemp2.addOptions(Option.SUPPRESS_EXCEPTIONS);

	return parseConf;
}

function getJsonPathParsingContext(parseConf, json)
{
	return JsonPath.using(parseConf).parse(json);
}


function parseRead(parseConf, json, jsonPath)
{
    var result = JsonPath.using(parseConf).parse(json).read(jsonPath);

    return result;
}

function parseReadGetByIndex(parseConf, json, jsonPath, i)
{
    var result = JsonPath.using(parseConf).parse(json).read(jsonPath);

    if (result == null)
    {
        return null;
    }
    else
    {
        if (result.getClass() == "class net.minidev.json.JSONArray")
        {
            if (i >= 0 && i < result.size())
            {
                return result.get(i);
            }
        }
        else
        {
            return result;
        }
    }
}


function parseReadGetByResRef(parseConf, json, resourceRef)
{
    if (!resourceRef)
    {
        return null;
    }

    //for embedded/contained resource references, we don't have a resource type, only resource ID
    if (resourceRef.startsWith('#'))
    {
        var jp = '$[?(@.id == "' + resourceRef.substring(1) + '")]';

        return parseReadGetFirst(parseConf, json, jp);
    }
    else
    {
        //find by resource type and resource ID
        var resourceInfo = resourceRef.split('/');
        return parseReadGetByResTypeResId(parseConf, json, resourceInfo[0], resourceInfo[1]);
    }
}

function parseReadGetByResTypeResId(parseConf, json, resourceType, resourceId)
{
    if (!resourceType || !resourceId)
    {
        return null;
    }

    var jp = '$[?(@.resourceType == "' + resourceType + '" && @.id == "' + resourceId + '")]';

    return parseReadGetFirst(parseConf, json, jp);
}


function parseReadGetFirst(parseConf, json, jsonPath, i)
{
    return parseReadGetByIndex(parseConf, json, jsonPath, 0);
}

