function mapPatientDeceasedStatus(fhirPatientDeceasedBoolean, fhirPatientDeceasedDateTime) {

    if ((!fhirPatientDeceasedBoolean || fhirPatientDeceasedBoolean.toString().trim() == "") &&
        (!fhirPatientDeceasedDateTime || fhirPatientDeceasedDateTime.toString().trim() == "")) {
        return "";
    }

    if (fhirPatientDeceasedBoolean) {

        fhirPatientDeceasedBooleanStr = fhirPatientDeceasedBoolean.toString().toLowerCase().trim();

        if (fhirPatientDeceasedBooleanStr == 'true') {
            return "Y";
        }
        else {
            return "N";
        }
    }

    //if we get here, it means the death date/time was specified, make sure the date is valid first
    try
    {
        var dt = new org.joda.time.DateTime(fhirPatientDeceasedDateTime);
    }
    catch(err)
    {
    		//Invalid date- be conservative and return nothing
        return "";
    }

    //Valid death date/time
    return "Y";
}

